    navigate(url);
  };

  return (
    <section className="hero is-medium is-fullheight">
      <div className="her">
      <Button onClick={() => onClickButton("/game")} text="Haz click para iniciar el juego"/>
      </div>
    </section>
  );
}

export default Home;
